How to use MongoDB with r2d2 and actix in rust<p>I am trying to make a basic web application with the <strong>rust</strong> language, using the <strong>actix</strong> framework and <strong>r2d2</strong> with <strong>mongodb</strong> as the database. I could not find any complete and working documentation on how to archive this. Maybe someone can help me out here.</p>

<p>The problem is, that i can't seem to get a mongodb connection from the r2d2 connection pool. Sadly this part isnt covered in any documentation i found.</p>

<p>Some links i found:</p>

<ul>
<li>Using r2d2 with actix: <a href="https://github.com/actix/examples/blob/master/r2d2/src/main.rs" rel="nofollow noreferrer">https://github.com/actix/examples/blob/master/r2d2/src/main.rs</a></li>
<li>Using mongodb with r2d2: <a href="https://docs.rs/r2d2-mongodb/0.2.2/r2d2_mongodb/" rel="nofollow noreferrer">https://docs.rs/r2d2-mongodb/0.2.2/r2d2_mongodb/</a></li>
</ul>

<hr>

<p>This part creates the connection pool and hands it to actix.</p>

<pre><code>fn main() {
    std::env::set_var("RUST_LOG", "actix_web=info");
    env_logger::init();

    let manager = MongodbConnectionManager::new(
        ConnectionOptions::builder()
            .with_host("localhost", 27017)
            .with_db("mydatabase")
            .build()
    );    

    let pool = Pool::builder()
        .max_size(16)
        .build(manager)
        .unwrap();

    HttpServer::new( move || {
        App::new()
            // enable logger
            .wrap(middleware::Logger::default())
            // store db pool in app state
            .data(pool.clone())
            // register simple handler, handle all methods
            .route("/view/{id}", web::get().to(view))
    })
    .bind("127.0.0.1:8080")
    .expect("Can not bind to port 8080")
    .run()
    .unwrap();
}
</code></pre>

<p>This is the handler function trying to access the connection pool</p>

<pre><code>fn view(req: HttpRequest, 
        pool: web::Data&lt;Pool&lt;MongodbConnectionManager&gt;&gt;) -&gt; impl Responder {

    let id = req.match_info().get("id").unwrap_or("unknown");
    let conn = pool.get().unwrap();
    let result = conn.collections("content").findOne(None, None).unwrap();

   // HERE BE CODE ...

    format!("Requested id: {}", &amp;id)
}
</code></pre>

<hr>

<p>This is the error showing my problem. The conn variable doesnt seem to be a propper mongodb connection.</p>

<pre><code>error[E0599]: no method named `collections` found for type `std::result::Result&lt;r2d2::PooledConnection&lt;r2d2_mongodb::MongodbConnectionManager&gt;, r2d2::Error&gt;` in the current scope  --&gt; src\main.rs:29:23
   |
29 |     let result = conn.collections("content").findOne(None, None).unwrap();
   |   
</code></pre>

