<p>What I am doing incorrect? Thanks for any help.</p>; Answer: I don't think it makes sense to store the data in the database for your use case. There are some use-cases when it makes sense (e.g. if you want to backup or mirror your database somewhere else, create dumps, etc.). Storing them as files on your server is the more straight-forward approach, and I'm not aware that storing them in the database would increase your performance... Put aside that you have more hassle writing and reading the data from the database directly...

