MongoDB Change Streams - Error [ERR_HTTP_HEADERS_SENT]<p>I'm trying to build an application which at the moment simply console logs Mongo documents in the client browser. I understand the Mongo change streams fine on the server side and have the following code to watch for inserts into the collection and when a change occurs, the dataset is reloaded:</p>

<pre><code>MongoClient.connect(MongoConnection.url, { useNewUrlParser: true, useUnifiedTopology: true }, (err, client) =&gt; {
    const db = client.db('test');
    const collection = db.collection('options');
    const changeStream = collection.watch();
    changeStream.on('change', next =&gt; {
        // If there is a change in the collection, reload the data.
        reload();
    });
});
function reload() {
    MongoClient.connect(MongoConnection.url, { useNewUrlParser: true, useUnifiedTopology: true }, (err, client) =&gt; {
        const db = client.db('test');
        const collection = db.collection('options');
        collection.find({}).toArray(function (err, docs) {
            client.close();
            console.log(docs)
        });
